geregisseerd door Chris Fisher
met Ray Liotta, Shawn Hatosy en Clifton Powell

Marty Kingston (Ray Liotta), een politierechercheur uit Detroit, is neergeschoten tijdens een undercover drugsinval toen hij zijn partner Sal Quintana probeerde te redden en mag van geluk spreken dat hij het overleefd heeft. Vier jaar later, nadat zijn partner is vermoord, gaat hij samenwerken met de heetgebakerde rechercheur Dan Sullivan (Shawn Hatosy) om de gruwelijke slachtingen van een aantal collega's te onderzoeken.

